import React, { useContext } from "react";
import ProductItem from "./ProductItem";

import styles from "./ProductsGrid.module.scss";
import { ProductsContext } from "../contexts/ProductsContext";

const ProductsGrid = () => {
  const { products } = useContext(ProductsContext);

  return (
    <div className={styles.p__container}>
      <div className="row align-items-center ">
        <div className="col-sm-8" style="padding-top:20px">
          <div className="btn-group d-flex" role="group">
            <button className="btn btn-outline-info w-100"> 24h </button>
            <button className="btn btn-outline-info w-100"> 12h </button>
            <button className="btn btn-outline-info w-100"> 4h </button>
            <button className="btn btn-outline-info w-100"> 4h </button>
            <button className="btn btn-outline-info w-100"> 4h </button>
          </div>
        </div>

        <div className="col-sm-4">
          <div className="form-group">
            <input
              type="text"
              name=""
              placeholder="Search product"
              className="form-control"
              id="searchBar"
            />
          </div>
        </div>
      </div>
      <div className={styles.p__grid}>
        {products.map((product) => (
          <ProductItem key={product.id} product={product} />
        ))}
      </div>
      <div className={styles.p__footer}></div>
    </div>
  );
};

export default ProductsGrid;
